import React from 'react';

function Footer() {
  return(
    <footer className='mt-5'>
      <Container>
        <Row>
          <Col className='p-0' md={3} sm={12}>
            Elliot Gallagher
          </Col>
          <Col></Col>
        </Row>
      </Container>
    </footer>
  );
}

export default Footer;
